// src/pages/Welcome.js
import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import "../styles/Welcome.css"; // Ensure the path is correct

const Welcome = () => {
  const navigate = useNavigate(); // Initialize the useNavigate hook

  // Function to handle the button click
  const handleStartClick = () => {
    navigate("/login"); // Navigate to the login page
  };

  return (
    <div className="welcome-container">
      <div className="welcome-content">
        <h1 className="welcome-title">Hi, Welcome to Fitness Assistant!</h1>
        <p className="welcome-description">
          We're here to help you track your workouts, meals, and fitness progress. 
          Let's get started and make your fitness journey enjoyable and productive.
        </p>
        <button className="start-btn" onClick={handleStartClick}>Start Now</button>
      </div>
    </div>
  );
};

export default Welcome;
